require 'benchmark'

# @param {Integer[]} nums
# @param {Integer} k
# @return {Integer}
def max_sum nums, count
  sum = nums.first(count).sum
  (1..nums.length - count).each do |i|
    current_sum = nums[i, count].sum
    sum = [sum, current_sum].max
  end
  sum
end

def max_subarray_sum(nums, k)
  count = (nums.length - nums.length % k) / k
  s = max_sum(nums, k)
  (count - 1).times do |i|
    s1 = max_sum(nums, k*(i+2))
    s = [s, s1].max
  end
  s
end

